                <span onClick={()=>{setLike(like +1)}}>üòò</span>
                {like}
            </h3>
            <h3>
                {testTitle[1]}
            </h3>
            <h3>
                {testTitle[2]}
            </h3>
            <div>
            <table className="MineTable">
                <tr>
                    <button className="MineCube" onClick={()=>{ChangeCubeColor()}}>
                    {cubeColor[0]}
                    </button>
                    <button className="MineCube">
                    {cubeColor[0]}
                    </button>
                </tr>
                <tr>
                    <button className="MineCube">
                    {cubeColor[0]}
                    </button>
                    <button className="MineCube">
                    {cubeColor[0]}
                    </button>
                </tr>
            </table>
            </div>
        </div>
    );
}

export default Test;
